INSERT INTO `tbl_character` (`id`, `v_character_text`, `v_character_description`, `v_image`, `v_job`, `status`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Electron Pioneer', 'As an electron pioneer you improve every element of everyday life. You could use your chemical engineering skills to design and manage processes that turn raw materials such as oil into everyday products such as smartphones. You could be solving problems on a chocolate production line, creating new technologies to combat air or water pollution, or developing new ways to beat cancer. Jobs include:', 'Chemical.png', '1,2,3', 1, 1, '2020-01-23 12:50:28', '2020-01-23 13:17:12', NULL),
(2, 'Electron Pioneer', 'As an electron pioneer you improve every element of everyday life. You could use your chemical engineering skills to design and manage processes that turn raw materials such as oil into everyday products such as smartphones. You could be solving problems on a chocolate production line, creating new technologies to combat air or water pollution, or developing new ways to beat cancer. Jobs include:', 'Chemical.png', '1,2,3', 1, 0, '2020-01-23 13:01:12', '2020-01-23 13:01:25', NULL),
(3, 'Future Lifesaver', '\"As a future lifesaver the world depends on you. You could use your biomedical engineering or medical physics expertise in a hospital, a lab or in industry, coming up with innovations that improve our health and quality of life. You could be developing medical devices such as MRI scanners, researching tissue for implants, designing prosthetic limbs, and using robots to perform operations remotely.  Jobs include:   \"', 'Medical-old.png', '4,5,6', 1, 0, '2020-01-23 13:03:53', '2020-01-23 13:04:41', NULL),
(4, 'Mechanical Marvel', 'As a mechanical marvel you keep the world in motion. You could work in the field of mechanical or biomechanical engineering. Your work might involve anything from designing Formula 1 cars and building planes to creating artificial heart valves and developing prosthetic limbs. Every machine you can think of relies on the skills of a mechanical engineer. Jobs include:', 'Mechanical.png', '7,8,9', 1, 0, '2020-01-23 13:22:57', '2020-01-23 13:23:06', NULL),
(5, 'Cure Creator', 'As a cure creator you\'re in the business of saving lives. You could work in the field of biochemical engineering, along with other types of engineers, solving problems that affect people, animals or plants. You could be researching and developing cancer treatments and vaccinations or making foods more nutritious. Jobs include:', 'Group 21.png', '9,11,12', 1, 0, '2020-01-23 13:24:48', '2020-01-23 13:25:23', NULL),
(6, 'Coding Legend', 'As a coding legend, you make your mark in the digital world! Software engineers and computer scientists are in demand in all sectors including industry, entertainment and retail. You could be working on human-computer interaction, computer graphics, robotics and information security. Jobs include:', 'Computer-Science-old.png', '14,58,59', 1, 0, '2020-01-23 13:36:11', '2020-01-23 13:44:54', NULL),
(7, 'Crime Preventer', 'As a crime preventer, you make the world a safer place. You could work in the fields of security and crime science to help protect us and keep us safe. You could be designing anti-theft devices, improving cyber security or finding the forensic evidence used in criminal trials. Jobs include:', 'Security Crime.png', '39,40,41', 1, 0, '2020-01-23 13:51:48', '2020-01-24 05:48:56', NULL),
(8, 'Civilization Saver', 'As a civilisation saver you create the cities of the future. You could use your civil and environmental engineering skills to keep us safe from flooding, design transport systems and construct hospitals, schools and sports arenas, while minimising the impact on our environment. Jobs include:', 'Civil.png', '19,43,44', 1, 0, '2020-01-24 05:48:03', '2020-01-24 10:20:48', NULL),
(9, 'Electric Dynamo', 'As an electric dynamo you light up the world. As an electrical or electronics engineer you could be designing the latest smartphone or robot, creating a state-of-the-art electric car, developing a GPS system or inventing a new way to generate power.  Jobs include:', 'Electrical-old.png', '24,45,60', 1, 0, '2020-01-24 06:19:03', '2020-01-24 06:54:21', NULL),
(10, 'Universe Explorer', 'As a universe explorer, the sky\'s not the limit!  Your aerospace engineering skills could help you design the next generation of aircraft, reduce the pollution caused by air travel, build drones and put satellites in space. You might also work in the transport sector and Formula 1. Jobs include:', 'Aerospace.png', '48,50,61', 1, 0, '2020-01-24 06:34:59', '2020-01-24 06:54:22', NULL),
(11, 'Sea Crusader', 'As a sea crusader, dive into an ocean of possibilities! You could use your marine engineering skills as part of a team that constructs off-shore platforms, explores the sea bed, designs ships and remotely operated underwater vehicles, or even plans lighthouses. Jobs include:', 'Marine.png', '51,52,53', 1, 0, '2020-01-24 06:51:57', '2020-01-24 06:54:22', NULL),
(12, 'Materials Maker', 'As a materials maker you shape the products of the future. Working in manufacturing and materials engineering, you could use your skills to work out how to get the best out of all the materials available to us in the safest, greenest way possible, turning raw materials into finished products. You could work with cars, wind turbine blades, sports equipment, packaging and smartphones. Jobs include:', 'Manufacturing Production.png', '54,55,56', 1, 0, '2020-01-24 06:56:07', '2020-01-24 09:07:57', NULL);

