INSERT INTO `tbl_cms` (`id`, `v_title`, `t_content`, `v_slug`, `i_order`, `status`, `v_image`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Meet the future you', '<h1>Ever wondered what an engineer does?</h1>\r\n\r\n<p>Answer a few short questions and find out how YOUR skills and passions could lead to an exciting job in the future.</p>\r\n\r\n<p>Whether you\'\'re just starting out, or are ready to think about your next steps, this is the quiz for YOU.</p>\r\n\r\n<p>Take the quiz and get ready to be inspired…</p>', 'intro_page', 0, 1, '1577702712-Civil.png,1577702712-Computer-Science.png,1577702712-Creativity.png', 0, '2019-02-04 19:46:26', '2020-01-20 13:16:08', NULL),
(2, 'Thank you for taking the quiz.', '<p>There are lots of different ways to become an engineer after you leave school. You could go to college, do an apprenticeship, go to university or combine different routes.</p><p>Find out more about how to become an engineer and the different types of engineering at:<br><a href=\'http://www.tomorrowsengineers.org.uk\'>www.tomorrowsengineers.org.uk</a></p>', 'final-page', 2, 1, '', 0, '2019-02-04 19:46:26', '2020-01-20 13:16:09', NULL),
(3, 'Result Page', '<p>Congratulations! With these skills, you could have a great future in engineering. Engineers use their skills and knowledge to solve problems, making a difference to the world and improving how we live.</p><p>There are lots of different ways to get into engineering after you leave school. You could go to college, do an apprenticeship, go to university or combine different routes.</p>', 'result-page', 3, 1, '', 0, '2019-02-04 21:14:49', '2020-01-20 13:16:10', NULL),
(4, 'Thank you for your feeback.', '<p>Your answers will help us make the quiz even better in the future.</p>', 'feedback-thankyou-page', 4, 1, '', 0, '2019-02-04 19:46:26', '2020-01-20 13:16:12', NULL),
(5, 'Feedback', '<p>We would love to hear your thoughts about the quiz you have just taken. Please spend 2 minutes answering the questions below.</p>', 'feedback-page', 5, 1, '', 0, '2019-02-25 15:26:20', '2020-01-20 13:16:13', NULL),
(9, 'Test', 'User', '', 0, 0, '', 1, '2020-01-21 13:31:48', '2020-01-21 13:32:05', NULL),
(10, 'Test', 'Test', '', 0, 0, '', 1, '2020-01-23 05:35:44', '2020-01-23 05:36:29', NULL),
(11, 'Test', 'Test', '', 0, 0, '', 1, '2020-01-23 05:36:13', '2020-01-23 05:36:39', NULL),
