INSERT INTO `tbl_discipline` (`id`, `v_discipline_text`, `v_discipline_description`, `v_character_id`, `v_image`, `status`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Chemical engineering', 'As an electron pioneer you improve every element of everyday life. You could use your chemical engineering skills to design and manage processes that turn raw materials such as oil into everyday products such as smartphones. You could be solving problems on a chocolate production line, creating new technologies to combat air or water pollution, or developing new ways to beat cancer. Jobs include:', 2, 'Chemical.png', 1, 0, '2020-01-24 08:48:47', '2020-01-24 09:12:38', NULL),
(2, 'Medical physics and biomedical enigneering', '\"As a future lifesaver the world depends on you. You could use your biomedical engineering or medical physics expertise in a hospital, a lab or in industry, coming up with innovations that improve our health and quality of life. You could be developing medical devices such as MRI scanners, researching tissue for implants, designing prosthetic limbs, and using robots to perform operations remotely.  Jobs include:   \"', 3, 'Medical.png', 1, 0, '2020-01-24 08:54:28', '2020-01-24 09:12:35', NULL),
(3, 'Mechanical and biomechanical', 'As a mechanical marvel you keep the world in motion. You could work in the field of mechanical or biomechanical engineering. Your work might involve anything from designing Formula 1 cars and building planes to creating artificial heart valves and developing prosthetic limbs. Every machine you can think of relies on the skills of a mechanical engineer. Jobs include:', 4, 'Mechanical.png', 1, 0, '2020-01-24 08:56:13', '2020-01-24 09:12:27', NULL),
(4, 'Biochemical engineering', 'As a cure creator you\'re in the business of saving lives. You could work in the field of biochemical engineering, along with other types of engineers, solving problems that affect people, animals or plants. You could be researching and developing cancer treatments and vaccinations or making foods more nutritious. Jobs include:', 5, 'Biochemical.png', 1, 0, '2020-01-24 08:56:35', '2020-01-24 09:12:26', NULL),
(5, 'Computer science', 'As a coding legend, you make your mark in the digital world! Software engineers and computer scientists are in demand in all sectors including industry, entertainment and retail. You could be working on human-computer interaction, computer graphics, robotics and information security. Jobs include:', 6, 'Computer-Science.png', 1, 0, '2020-01-24 08:57:06', '2020-01-24 09:12:27', NULL),
(6, 'Security and crime science', 'As a crime preventer, you make the world a safer place. You could work in the fields of security and crime science to help protect us and keep us safe. You could be designing anti-theft devices, improving cyber security or finding the forensic evidence used in criminal trials. Jobs include:', 7, 'Security Crime.png', 1, 0, '2020-01-24 08:57:51', '2020-01-24 09:12:28', NULL),
(7, 'Civil, environmental', 'As a civilisation saver you create the cities of the future. You could use your civil and environmental engineering skills to keep us safe from flooding, design transport systems and construct hospitals, schools and sports arenas, while minimising the impact on our environment. Jobs include:', 8, 'Civil.png', 1, 0, '2020-01-24 08:58:08', '2020-01-24 09:12:30', NULL),
(8, 'Electronic and electrical', 'As an electric dynamo you light up the world. As an electrical or electronics engineer you could be designing the latest smartphone or robot, creating a state-of-the-art electric car, developing a GPS system or inventing a new way to generate power.  Jobs include:', 9, 'Electrical.png', 1, 0, '2020-01-24 08:58:46', '2020-01-24 09:12:31', NULL),
(9, 'Aerospace', 'As a universe explorer, the sky\'s not the limit!  Your aerospace engineering skills could help you design the next generation of aircraft, reduce the pollution caused by air travel, build drones and put satellites in space. You might also work in the transport sector and Formula 1. Jobs include:', 10, 'Aerospace.png', 1, 0, '2020-01-24 08:59:11', '2020-01-24 09:12:31', NULL),
(10, 'Marine', 'As a sea crusader, dive into an ocean of possibilities! You could use your marine engineering skills as part of a team that constructs off-shore platforms, explores the sea bed, designs ships and remotely operated underwater vehicles, or even plans lighthouses. Jobs include:', 11, 'Marine.png', 1, 0, '2020-01-24 09:00:17', '2020-01-24 09:12:32', NULL),
(11, 'Manufacturing and materials – add', 'As a materials maker you shape the products of the future. Working in manufacturing and materials engineering, you could use your skills to work out how to get the best out of all the materials available to us in the safest, greenest way possible, turning raw materials into finished products. You could work with cars, wind turbine blades, sports equipment, packaging and smartphones. Jobs include:', 12, 'Manufacturing Production.png', 1, 0, '2020-01-24 09:11:04', '2020-01-24 11:45:39', NULL);

